import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import {
  useStripe,
  useElements,
  PaymentElement,
} from "@stripe/react-stripe-js";

const Checkout = () => {
  const [cart, setCart] = useState([]);
  const [form, setForm] = useState({ name: "", address: "" });
  const [msg, setMsg] = useState("");
  const [submitting, setSubmitting] = useState(false);
  const [clientSecret, setClientSecret] = useState("");

  const stripe = useStripe();
  const elements = useElements();
  const user = JSON.parse(localStorage.getItem("user"));
  const navigate = useNavigate();

  useEffect(() => {
    window.scrollTo(0, 0);
    const storedCart = JSON.parse(localStorage.getItem("cart")) || [];
    setCart(storedCart);

    const total = storedCart.reduce(
      (sum, item) => sum + item.price * item.quantity,
      0
    );

    // Create Stripe PaymentIntent
    if (user && total > 0) {
      axios
        .post("http://localhost:5000/api/payments/create-payment-intent", {
          amount: total,
        })
        .then((res) => setClientSecret(res.data.clientSecret))
        .catch((err) => console.error("Stripe init failed:", err));
    }
  }, [user]);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!stripe || !elements) return;

    if (!form.name.trim() || !form.address.trim()) {
      setMsg("Name and address are required.");
      return;
    }

    setSubmitting(true);

    const result = await stripe.confirmPayment({
      elements,
      confirmParams: {
        return_url: "http://localhost:3000/order-success", // redirect after payment
      },
    });

    if (result.error) {
      setMsg(result.error.message || "Payment failed.");
      setSubmitting(false);
    }
  };

  const getTotal = () =>
    cart.reduce((sum, item) => sum + item.price * item.quantity, 0).toFixed(2);

  if (!user) return <p className="text-center mt-10">Please log in to checkout.</p>;

  return (
    <div className="p-8 bg-gray-100 min-h-screen flex justify-center items-start">
      <div className="bg-white p-6 rounded shadow-md w-full max-w-lg">
        <h2 className="text-2xl font-bold mb-6 text-center">Checkout</h2>

        {cart.length === 0 ? (
          <p className="text-center text-gray-600">Your cart is empty.</p>
        ) : !clientSecret ? (
          <p>Preparing payment...</p>
        ) : (
          <form onSubmit={handleSubmit} className="space-y-6">
            <div>
              <label className="block text-sm font-semibold mb-1">Name</label>
              <input
                type="text"
                name="name"
                value={form.name}
                onChange={handleChange}
                className="w-full p-2 border border-gray-300 rounded"
                placeholder="Full name"
                required
              />
            </div>

            <div>
              <label className="block text-sm font-semibold mb-1">Address</label>
              <textarea
                name="address"
                value={form.address}
                onChange={handleChange}
                className="w-full p-2 border border-gray-300 rounded"
                placeholder="Shipping address"
                required
              />
            </div>

            <div className="border-t pt-4">
              <PaymentElement />
            </div>

            <div className="font-bold mt-4 text-right">
              Total: ${getTotal()}
            </div>

            <button
              type="submit"
              disabled={!stripe || !elements || submitting}
              className={`w-full bg-green-600 text-white p-2 rounded hover:bg-green-700 transition ${
                submitting ? "opacity-50 cursor-not-allowed" : ""
              }`}
            >
              {submitting ? "Processing..." : "Pay Now"}
            </button>

            {msg && (
              <p className="text-center text-sm mt-3 text-red-600 font-medium">{msg}</p>
            )}
          </form>
        )}
      </div>
    </div>
  );
};

export default Checkout;
